sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

  if(inputs.status == "200"){

    var resp = inputs.response;
    var parsed = JSON.parse(resp);
    var zipcodes = parsed["data"];
    zipcodes.forEach(createZipcodes);
  	const city = inputs.city;
    const state = inputs.state;
  }
})(inputs, outputs);

function createZipcodes(item,city,state){

    var parsedItem = JSON.parse(JSON.stringify(item));
    var avail = new GlideRecord('x_598934_find_hosp_zip_codes_by_city_or_state');

 	if(avail.hasNext()){
      avail.next();
      avail.zip = parsedItem;
      avail.state = state;
      avail.city = city;
      avail.update();

    } else {
      avail.initialize();
      avail.zip = parsedItem;
      avail.city = city;
      avail.state = state;
      avail.insert();

    }

}

